import React from "react";
import './style/Backstage.css'
import Stream from './Stream';

function BackstagePage(){
  var position1 = false;
  var position2 = false;
  var Position3 = false;
  var position4 = false;


  togglePosition1 = () => {
    position1 = !position1;
  };

  togglePosition2 = () => {
    position2 = !position2;
  };

  togglePosition3 = () => {
    position3 = !position3;
  };

  togglePosition4 = () => {
    position4 = !position4;
  };

  return(
      <div className="Backstage">
          <h4>BACKSTAGE</h4>
          <Stream  />
          <button id="position1" onClick={togglePosition1}> Position 1 </button>
          <button id="position2" onClick={togglePosition2}> Position 2 </button>
          <button id="position3" onClick={togglePosition3}> Position 3 </button>
          <button id="position4" onClick={togglePosition4}> Position 4 </button>

      </div>
  );
}

export default BackstagePage
